import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input and type a query
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'Electronics');

    // Take screenshot after filling the search input
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_input.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_input.png'));

    // Click on the search button
    await page.waitForSelector('.search-btn', { timeout: 5000 });
    await page.click('.search-btn');

    // Take screenshot after clicking the search button
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_button_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_button_clicked.png'));

    // Wait for the profile link and click it
    await page.waitForSelector('a:has-text("Your Profile")', { timeout: 5000 });
    await page.click('a:has-text("Your Profile")');

    // Take screenshot after navigating to profile
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_profile_page.png'));

    // Extract profile information
    const profileData = await page.evaluate(() => {
      const username = document.querySelector('.username')?.textContent || '';
      const fullName = document.querySelector('h2')?.textContent || '';
      const bio = document.querySelector('.bio')?.textContent || '';
      return { username, fullName, bio };
    });

    return {
      success: true,
      action: "Harvested user profile information",
      extractedData: profileData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
